import React from 'react';
import { Link } from 'react-router-dom';
import '../style'

const Slider_Ecommerce = () => {
    return ( 
        <div className="navigation">
            <div className="container">
                <div className="row">
                    <div className="col-lg-12 col-md-12 col-sm-12 col-12">
                        <div className="right-icon text-left">
                            <ul>
                                <li><Link href="https://sotooracademy.com/sotoor-ecommerce"><img src="https://sotooracademy.com/public/sotoor_ecommerce_assets/images/main-logo.png" width="30px" /> متجر سطور للقدرات </Link></li>
                                <li><Link href="https://sotooracademy.com/cart"><i className="fa fa-shopping-bag"></i><span>0 </span></Link></li>
                                <li><Link href="https://sotooracademy.com/login"><i className="fa fa-user-circle-o"></i>  </Link></li>
                            </ul>
                        </div>
                    </div>
                </div> 
            </div> 
        </div>
     );
}

export default Slider_Ecommerce;
